 package sp.com; import android.os.Bundle; import android.support.v7.app.ActionBarActivity; import android.view.Menu; import android.view.View; import android.widget.Button; import android.widget.EditText; import android.widget.RadioGroup; import android.widget.Toast; public class RestaurantList extends ActionBarActivity { private EditText name; private RadioGroup restaurantTypes; private Button save; @Override protected void onCreate(Bundle savedInstanceState) { super.onCreate(savedInstanceState); setContentView(R.layout.main); name = (EditText) findViewById(R.id.name); restaurantTypes = (RadioGroup) findViewById(R.id.types); save = (Button) findViewById(R.id.save); save.setOnClickListener(onSave); } private View.OnClickListener onSave = new View.OnClickListener() { @Override public void onClick(View v) { String nameStr = name.getText().toString(); String restType = ""; switch (restaurantTypes.getCheckedRadioButtonId()){ case R.id.chinese: restType = "Chinese"; break; case R.id.indian: restType = "Indian"; break; case R.id.western: restType = "Western"; break; case R.id.indonesian: restType = "Indonesian"; break; case R.id.korean: restType = "Korean"; break; case R.id.japanese: restType = "Japanese"; break; case R.id.thai: restType = "Thai"; break; } String combineStr = nameStr + "\n"+ restType; Toast.makeText(v.getContext(), combineStr, Toast.LENGTH_LONG).show(); } }; @Override public boolean onCreateOptionsMenu(Menu menu) { // Inflate the menu; this adds items to the action bar if it is present. getMenuInflater().inflate(R.menu.restaurant_list, menu); return true; } } 
